import React, { useState } from 'react'

const Employees = () => {
    const [name,setName]=useState('');
  return (
    <div className='max-w-xl mx-auto mt-10 p-6 bg-white'>
        <h1 className='text-blue-600 text-2xl font-bold text-center mb-6'>Find Employee</h1>
        <div className='flex items-center justify-center gap-4'>
            <input className='p-2 border rounded' placeholder='Enter Name' onChange={(e)=>setName(e.target.name)} value={name}/>
            <button className='border bg-blue-500 rounded-md p-2 text-white hover:bg-blue-600'>Search</button>
        </div>
    </div>
  )
}

export default Employees
